import React from "react";
import Jumbotron from "bootstrap";

const Header = () => {
  return (
    <div>
      <div class="jumbotron">
        <h1 class="display-4">Welcome to Blogers World!</h1>
        <p class="lead">
          Here you can read blogs, 
        </p>

      </div>
    </div>
  );
};

export default Header;
